import React from "react";

const Players = ({ players }) => {
  return (
    <div className="section-center">
      {players.map((player) => {
        return (
          <article key={player.id} className="menu-item">
            <div className="item-info">
              <header>
                <h4>{player.data.name}</h4>
                <h4 className="price">{player.data.maxbid}</h4>
              </header>
              <p className="item-text">{player.data.baseprice}</p>
            </div>
          </article>
        );
      })}
    </div>
  );
};

export default Players;
